const Asset = ({
  asset,
  is_editing,
  formatToCurrency,
  toggleEditing,
  currency,
  currency_codes,
  updateInputValue
}) => {
  return (
    <tr>
      <td>{asset.text}</td>
      <td></td>
      <td>
        <div className="input-group input-group-sm">
          <span className="input-group-text" id="inputGroup-sizing-sm">
            {currency_codes}
          </span>
          {is_editing ? (
            <input
              type="number"
              className="form-control"
              name={asset.id}
              id={asset.name}
              value={Math.round(asset.value)}
              onInput={updateInputValue}
              onBlur={this.toggleEditing}
            ></input>
          ) : (
            <input
              type="text"
              className="form-control"
              name={asset.id}
              id={asset.name}
              value={formatToCurrency(Math.round(asset.value))}
              onFocus={this.toggleEditing}
              readOnly
            ></input>
          )}
        </div>
      </td>
    </tr>
  );
};

export default Asset;
